const axios = require('axios');
const https = require('https');
const aws4  = require('aws4');
const crypto = require('crypto');


const instance = axios.create({
  httpsAgent: new https.Agent({  
    rejectUnauthorized: false
  })
});
const cred = {
  accessKeyId:'',
  secretAccessKey:''
}
const options = {
  region: 'hn1',
  service: 'sign'
}
instance.interceptors.request.use(
  (config) => {
    config.headers['Content-Type'] = 'application/json; charset=utf-8';
    
    console.log(config);
    let url = config.url;
    if (config.baseURL && !isAbsoluteURL(config.url)) {
      url = combineURLs(config.baseURL, config.url);
    }
    const { host, pathname, search } = new URL(url);
    const { data, headers, method } = config;
    const { transformRequest } = config;
    let req = {};
    if (transformRequest) {
      if (typeof transformRequest === "function") {
        req = transformRequest;
      } else if (transformRequest.length) {
        req = transformRequest[0];
      }
    }
    const transformedData = req(data, headers);
    const hash = crypto.createHash('sha256');
    hash.update(transformedData);
    config.headers['X-Amz-Content-Sha256'] = hash.digest('hex');
    // Remove all the default Axios headers
    const {
      common,
      delete: _delete, // 'delete' is a reserved word
      get,
      head,
      post,
      put,
      patch,
      ...headersToSign
    } = headers;
    
    const signingOptions = {
      method: method && method.toUpperCase(),
      host,
      path: pathname + search,
      region: options?.region,
      service: options?.service,
      body: transformedData,
      headers: headersToSign ,
    };
    aws4.sign(signingOptions, cred);
    config.headers = signingOptions.headers;
    return config;
  },
  (error) => {
    // Do something with request error
    return Promise.reject(error);
  });
  const input = {
    "base64xml": "",
    "hashalg": "SHA-256",
    "signdate": "21-03-2023 05:47:52",
    "datapath": [
      "//RootPaper/Root"
    ],
    "signaturepath": "//RootPaper",
    "signatureid": "3117ea9f-2621-4bda-bbfb-51601474c4fc"
  }
  let jsonreq = JSON.stringify(input);
  instance.post('https://sign-hn4.vin-hsm.com/api/v2/xml/sign/refs', jsonreq).then(function (response) {
  if(response.data.status ===0)
  {
    console.log("Ky xml thanh cong");
    console.log(response.data);
  }
  else
  {
    console.log(response.data.error);
  }
})
.catch(function (error) {
console.log(error);
});


